export const Button = (props) => (
  <button 
  onClick={props.onClick || null}
  disabled={props.disabled || false}
  >
     { props.children }
     <style jsx>{`
        button {
          padding: ${ 'large' in props ? '20' : '5' }px;
          background: ${props.background};
          color: green;
          display: inline-block;
          font-size: 1em;
        }
        button::disabled {
            color: greey;
        }
     `}</style>
  </button>
)
